アクアフレッシュ トラベルソフト ケースセット<br>ブランド：アクアフレッシュ<br>販売・製造元：アース製薬<br><br>MAGやフッ素などを配合した歯磨きです。<br>歯周病や、口臭、むし歯を予防します。<br>オフィスや外出先にも手軽に携帯できるケースセット。<br>医薬部外品。<br>*緑・ピンク・紫・オレンジの4色ありますが、色はお選びいただけません。<br> <br>ご注意<br>(ハミガキ)傷などに直接つけないようにしてください。<br>発疹などの異常が現れた場合は使用を中止し、医師に相談してください。<br> <br>成分<br>(ハミガキ)ポリエチレングリコール、ラウリル硫酸塩、安息香酸塩、赤色226号、香料 品質表示(ハブラシ)柄の材質白色部：ポリプロピレン着色部：SBC、ポリプロピレン毛の材質毛のかたさ耐熱温度ナイロンふつう80度<br> 原産国ハミガキ：アメリカハブラシ：ドイツ <br>日用品／オーラルケア／歯磨き(ハミガキ)／フッ素配合歯磨き<br>JANコード： 4901080758712<br><br>CS：72<br>区分：医薬部外品<br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
