ウルモア 保湿入浴液 クリーミーローズの香り 詰替用 480ml(入浴剤)<br>ブランド：ウルモア<br>販売・製造元：アース製薬<br><br>入浴後もうるおいベールが続くスキンケア入浴剤詰め替え用です。<br>素肌の乾燥に着目して開発した保湿入浴剤で、赤ちゃんから高齢者の方まで、乾燥肌に悩むすべてに方の素肌をやさしく包み込み、しっとり、すべすべにします。<br>クリーミーローズの香り。<br>※本品には浴槽・風呂釜をいためるイオウは入っておりません。<br>  <br><br><br>使用方法<br>●ボトルは水道水で洗い、よく乾かしてからつめかえてください。<br>●他の製品と混ざらないようにしてください。<br>●必ず「保湿入浴剤ウルモア(クリーミーローズの香り)」のボトルに詰め替えてください。<br>●つめかえ後はパックの製造番号を切り取ってボトルに貼り付けてください。<br>お問い合わせの際に必要な場合があります。<br>(1)フタを開けます(2)ボトルを押して計量の線まで液を出します。<br>(キャップの一番上のメモリまでが40mlです。<br>うるおいのお好みに応じて、使用料を調整してください。<br>)(3)浴槽の湯(200L)に本品40-80mlを入れ、よくかき混ぜて入浴してください。<br>(4)使用後はフタをきちっと閉め、計量キャップは水で洗わないでください。<br> <br><br>使用上の注意<br>●入浴以外の用途には使用しないこと。<br>●皮膚あるいは体質に異常がある場合は、医師に相談の上使用すること。<br>●使用中や使用後、皮膚に発疹、発赤、かゆみ、刺激感などの異常が現れた場合、使用を中止し医師又は薬剤師に相談すること。<br>特に、アレルギー体質の人や、薬などで発疹などの過敏症状を経験したことがある人は、十分注意して使用すること。<br>●本品は飲めません。<br>万一大量に飲み込んだときは、水を飲ませるなどの処置を行うこと。<br>●使用後は、フタをきちっと閉め、子供の手の届かないところに保管すること。<br> ご注意<br>にごりタイプについて●配合成分により、浴槽や洗い場では滑りやすくなりますので、十分注意すること。<br>●全自動給湯器、24時間風呂に使用するとフィルターが詰まる可能性があるので、お使いの機種の説明書を確認の上使用すること。<br>●使用後は、風呂釜内部や循環孔のフィルターなどが白く汚れることがありますので、よく水洗いすること。<br>(風呂釜内部の湯あかなどに白濁成分などが一部付き、循環孔から浴槽内へ出ることがあります。<br>)●残り湯を長く浴槽に入れておくと、浴槽のまわりが白くなることがありますが、すすぎ洗いをするときれいになります。<br>残り湯の利用について●残り湯は洗濯にもお使いになれますが、すすぎは清水を使うこと。<br>ただし以下の場合は使用しないこと。<br>(柔軟仕上げ剤との併用、つけおき、おろしたての衣類)●残り湯を植物にかけると影響が出る可能性がありますので、かけないこと。<br> <br>成分<br>水、ポリスチレン、グリセリン、PEG-60水添ヒマシ油、エタノール、香料、ポリソルベート20、ポリクオタニウム-10(うるおいベール成分)、フェノキシエタノール、メチルパラベン、プロピルパラベン、ヒアルロン酸ヒドロキシプロピルトリモニウム(吸着型ヒアルロン酸)、シア脂、ローヤルゼリーエキス、加水分解コラーゲン、グルコシルセラミド●本品には浴槽・風呂釜をいためるイオウは入っておりません。<br> <br><br>お問い合わせ先<br>アース製薬株式会社 お客様窓口：0120-81-6456受付時間9：00-17：00(土日祝日を除く)東京都千代田区神田司町2-12-1 入浴剤 スキンケアとはお肌にやさしい保湿成分・保護成分などを配合し、お肌のコンディションを整えるのに役立つ入浴剤です。<br><br>日用品／入浴剤・温浴器／入浴剤／入浴剤 スキンケア<br>JANコード： 4901080539410<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
