温素 柚子の香り 30g×15包(入浴剤)<br>ブランド：温素<br>販売・製造元：アース製薬<br><br>まろやかな湯ざわりの温浴効果で、お肌を柔らかくし、なめらかにする薬用入浴剤です。<br>本格感のあるまろやかな湯ざわりをお肌で実感できます。<br>さわやかな森林の香り。<br>医薬部外品。<br>  <br><br><br>使用方法<br>お風呂のお湯(200L)に本品1包(30g)を入れ、よくかきまぜて入浴して下さい。<br>*アレルギーテスト済み(すべての方にアレルギーが起きないというわけではありません) <br><br>使用上の注意<br>●入浴以外の用途には使用しないこと。<br>●皮膚あるいは体質に異常がある場合は、医師に相談の上使用すること。<br>●使用中や使用後、皮ふに発疹、発赤、かゆみ、刺激感などの異常が現れた場合、使用を中止し医師又や薬剤師に相談すること。<br>●本品は食べられません。<br>万一大量に飲み込んだときは、水を飲ませるなどの処置を行うこと。<br>●本品が誤って本品が直接目に入った場合は清水で十分に洗い流し、また顔や皮ふに直接付着した場合は石けんで十分洗い流し、異常があれば医師の診療を受けること。<br>●子供の手の届かないところに保管すること。<br>●開封後はすぐに使用すること。<br>●本品は温泉を再現したものではありません。<br>(使用している成分は本来の温泉由来のものではありません)**残り湯の利用について**●残り湯は洗濯にも使えますが、すすぎは清水で行うこと。<br>(ウールや絹など、おしゃれ着衣類で「中性」の英表示があるもの、色落ちの恐れのあるものは、残り湯を使用しないこと)●残り湯を植物にかけると影響が出る可能性があるのでかけないこと。<br>●残り湯を長く浴槽に入れておくと、水に含まれるウカルシウムイオンと温泉成分が反応し、ザラザラすることがあります。<br>スポンジでこすっても落ちない場合は、弱酸性のお風呂用洗剤で洗えばきれいになります。<br>(浴槽をいためているわけではありません) 成分●有効成分：乾燥硫酸ナトリウム、炭酸ナトリウム●その他の成分：無水ケイ酸、香料*本品には浴槽・風呂釜をいためるイオウは入っておりません。<br> 効能・効果疲労回復、あせも、しっしん、にきび、ひび、あかぎれ、しもやけ、荒れ性、うちみ、くじき、肩のこり、神経痛、リウマチ、腰痛、冷え症、痔、産前産後の冷え症 <br><br>お問い合わせ先<br>アース製薬株式会社お客様窓口 03-5207-6456受付時間 9：00-17：00(土・日・祝日を除く) <br>日用品／入浴剤・温浴器／入浴剤／薬用入浴剤 疲労回復<br>JANコード： 4901080553911<br><br>CS：8<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
